  "description": {
    "nb": "Havnekartserien består av 45 sjøkart i målestokk fra 1:5 000 til 1:25 000. Den dekker havner og innseilinger langs norskekysten. En del havnekart har spesialer i større målestokker over sentrale deler av havner eller trange farvann. Havnekart gir brukeren et detaljert bilde av dybdeforhold og kaianlegg i havnene. Tjenesten oppdateres to ganger pr måned med nye og endrede sjøkart."
  },
