  "description": {
    "nb": "Datasettet genereres fra Kartverkets datasett \"Statistiske enheter grunnkretser\" og kobles mot statistikk fra SSB som viser befolkningsmengde for grunnkretser. Datasettet vi viser totalbefolkning, antall menn, antall kvinner og befolkning i i fem-års aldersgrupper fra 0 til 90 år og over pr. grunnkrets. Det viser også befolkningsendring i forhold til befolkning pr. 1. januar for fem år tilbake."
  },
