  "title": {
    "nb": "SAT-SKOG - Volum"
  },
  "description": {
    "nb": "SAT-SKOG er et oversiktskart over skogressursene og gir informasjon om treslag, volum og alder. Tolkingen er basert på bildedata fra jordobservasjonssatellittene Landsat 5 og -7. Bildene sammenstilles med prøveflater fra Landsskogtakseringen, kartdata fra AR5 og terrengmodellen DTM. \nVolum er det totale volumet summert over alle treslagene (gran, furu, bjørk og andre lauvtreslag) på et areal. Det finnes også inndeling som summerer volumnet over alle gran-, furu- og lauvtrær."
  },
