  "title": {
    "nb": "Arealstatistikk for Norge 1994 - 2019"
  },
  "description": {
    "nb": "Arealstatistikken viser utstrekning (oppgitt i kvadratkilometer) for fylker, kommuner og grunnkretser fordelt på ulike arealtyper som havflate, innsjø, skog, dyrket mark, tettbebyggelse, med flere. Statistikken gjelder fra 1994 til og med 2018 med unntak av årene 1996, 2002, 2009, 2011, 2012.\nArealstatistikken etableres ut fra den administrative grensedatabasen ABAS og den landsdekkende kartdatabasen i målestokk 1:50 000 kalt N50 Kartdata."
  },
