  "title": {
    "nb": "Snø- og steinskred - aktsomhetsområder"
  },
  "description": {
    "nb": "Aktsomhetsområdene for snø- og steinskred viser aktsomhetsområder samlet for de to skredtypene. Det er som regel snøskredfaren som er dimensjonerende for utstrekningen av aktsomhetsområdene, fordi det er snøskred som normalt har størst rekkevidde. \n\nAktsomhetsområdene i disse kartene er identifisert ved å bruke helningskart for å finne terreng der skred kan utløses. Utløpsområdene er beregnet ved bruk av en empirisk basert modell utviklet av NGI. Dette arbeidet er gjort manuelt. Deretter er de aktuelle områdene befart og vurdert av skredsakkyndige, før grensa for aktsomhetsområdene er tegnet inn. \n\nKartserien dekker deler av landet. Bare områder som kan nås fra vei er befart, derfor er det på hvert kartblad store områder som ikke er vurdert.\n\nUtstrekningen av aktsomhetsområdene på disse kartene er vanligvis mindre enn aktsomhetsområdene på de nasjonalt dekkende, automatisk genererte aktsomhetskartene for snøskred, fordi skredkyndighet ved befaringer og har gitt mulighet til å ta hensyn til lokale faktorer som begrenser skredutløp, slik som skog, terrengdetaljer og lignende. \n\nAktsomhetsområdene omfatter ikke områder som kan være utsatt for sørpeskred."
  },
  "descriptionFormatted": {
