  "title": {
    "nb": "Jordsmonn - Dyrkingsklasse grønnsaker (Kun Vestfold)"
  },
  "description": {
    "nb": "Kommunvise kartlag i datasettet Jordsmonn som viser arealenes potensial for dyrking av grønnsaker under de økonomiske og teknologiske rammebetingelser som gjelder for dagens jordbruk. Arealfigurer etter jordtype. Rundt halvparten av Norges fulldyrka og overflatedyrka jord er jordsmonnskartlagt, med hovedvekt på Sør-Østlandet, Trøndelag og Jæren. På enkelte steder er også også innmarksbeite kartlagt. Kartlaget er fremstilt i målestokk 1:5000 og er tilpasset bruk i målestokker fra 1:5000 til 1:20 000. \nEgenskaper som skal brukes til å fremstille kartlaget er.\n\nAsparges (Egenskap: DK_ASPARG) \nBeter (Egenskap: DK_BETER)\nBlomkål/brokkoli (Egenskap: DK_BLOMK)\nBønner (Egenskap: DK_BONNER)\nGulrot/persillerot (Egenskap: DK_GULROT)\nHodekål (Egenskap: DK_HODEK)\nKålrot (Egenskap: DK_KALROT) \nKinakål (Egenskap: DK_KINAK) \nLøk (Egenskap: DK_LOK) \nMais (Egenskap: DK_MAIS) \nPurre (Egenskap: DK_PURRE) \nRosenkål (Egenskap: DK_ROSENK) \nSalat (Egenskap: DK_SALAT) \nSelleri (Egenskap: DK_SELLERI)\nTidligkulturer (Egenskap: DK_TIDLIG) \nVårløk(Egenskap: DK_VORLOK)\n\n. Areal i kvadratmeter er oppført i egenskap AREA_C."
  },
  "descriptionFormatted": {
    "nb": "Kommunvise kartlag i datasettet Jordsmonn som viser arealenes potensial for dyrking av grønnsaker under de økonomiske og teknologiske rammebetingelser som gjelder for dagens jordbruk. Arealfigurer etter jordtype. Rundt halvparten av Norges fulldyrka og overflatedyrka jord er jordsmonnskartlagt, med hovedvekt på Sør-Østlandet, Trøndelag og Jæren. På enkelte steder er også også innmarksbeite kartlagt. Kartlaget er fremstilt i målestokk 1:5000 og er tilpasset bruk i målestokker fra 1:5000 til 1:20 000. \nEgenskaper som skal brukes til å fremstille kartlaget er.\n\nAsparges (Egenskap: DK_ASPARG) \nBeter (Egenskap: DK_BETER)\nBlomkål/brokkoli (Egenskap: DK_BLOMK)\nBønner (Egenskap: DK_BONNER)\nGulrot/persillerot (Egenskap: DK_GULROT)\nHodekål (Egenskap: DK_HODEK)\nKålrot (Egenskap: DK_KALROT) \nKinakål (Egenskap: DK_KINAK) \nLøk (Egenskap: DK_LOK) \nMais (Egenskap: DK_MAIS) \nPurre (Egenskap: DK_PURRE) \nRosenkål (Egenskap: DK_ROSENK) \nSalat (Egenskap: DK_SALAT) \nSelleri (Egenskap: DK_SELLERI)\nTidligkulturer (Egenskap: DK_TIDLIG) \nVårløk(Egenskap: DK_VORLOK)\n\n. Areal i kvadratmeter er oppført i egenskap AREA_C."
