  "title": {
    "nb": "Stormflo"
  },
  "description": {
    "nb": "Datasettet er under utarbeidelse. Datasettet viser stormflo med gjentaksintervall på 20, 200 og 1000 år basert på nåsituasjonen, og beregnet og korrigert for havnivåstigning og landheving i 2050 og 2090. Stormflo oppstår når endringer i lufttrykk og vind endrer vannstanden betraktelig. Sammenfaller stormflo med en springperiode kan dette resultere i ekstra høy vannstand. En springperiode er en periode hvor tidevannet vil være høyere da krefter fra måne og sol virker i samme retninger rundt ny- og fullmåne. På grunn av stigende temperatur i havet og atmosfæren vil man i framtiden kunne oppleve stigende havnivå. Dette skyldes i stor grad termisk ekspansjon av vann, men også smeltevann fra tilbaketrekkende isbreer som tilføres havet. I store deler av Norge bremses noe av havnivåstigningen på grunn av landheving etter siste istid. Stormfloberegningene vil likevel være viktige i planarbeid slik at man skaffer oversikt over risiko og sårbarhet som følge av havnivåstigning og stormflo. Se produktspesifikasjon for ytterligere informasjon."
  },
