  "title": {
    "nb": "Andre finansprodukter"
  },
  "description": {
    "nb": "Opplysninger fra virksomheter omfattet av CRS/FATCA-reglene, og som ikke er omfattet av opplysningsplikt for Innskudd, utlån og renter, Livsforsikring eller Verdipapirfond, om utenlandske kontohavere.\n\nOpplysningsplikten omfatter alle kontohavere som er fysiske personer skattemessig bosatt i utlandet. En person kan være skattemessig bosatt i flere land, og opplysningsplikten vil da gjelde for hvert av de aktuelle landene. Opplysningsplikten omfatter også amerikanske statsborgere uavhengig av hvor de er bosatt.\n\nOpplysningsplikten omfatter kontohavere som er selskap mv. skattemessig hjemmehørende i utlandet. Et selskap mv. kan være skattemessig hjemmehørende i flere land, og opplysningsplikten vil da omfatte hvert av landene.\n\nOpplysningsplikten omfatter reelle rettighetshavere skattemessig bosatt i utlandet og/eller som er amerikanske statsborgere. En reell rettighetshaver kan være skattemessig bosatt i flere land, og opplysningsplikten vil da gjelde for hvert av de aktuelle landene. Opplysninger om reelle rettighetshavere skattemessig bosatt i Norge, skal gis fra inntektsåret 2018. Opplysningsplikten omfatter reelle rettighetshavere i selskap mv. som omtalt i \"rettledning om internasjonal rapportering av finansielle konti – CRS/FATCA \"."
  },
  "descriptionFormatted": {
    "nb": "Opplysninger fra virksomheter omfattet av CRS/FATCA-reglene, og som ikke er omfattet av opplysningsplikt for Innskudd, utlån og renter, Livsforsikring eller Verdipapirfond, om utenlandske kontohavere.\n\nOpplysningsplikten omfatter alle kontohavere som er fysiske personer skattemessig bosatt i utlandet. En person kan være skattemessig bosatt i flere land, og opplysningsplikten vil da gjelde for hvert av de aktuelle landene. Opplysningsplikten omfatter også amerikanske statsborgere uavhengig av hvor de er bosatt.\n\nOpplysningsplikten omfatter kontohavere som er selskap mv. skattemessig hjemmehørende i utlandet. Et selskap mv. kan være skattemessig hjemmehørende i flere land, og opplysningsplikten vil da omfatte hvert av landene.\n\nOpplysningsplikten omfatter reelle rettighetshavere skattemessig bosatt i utlandet og/eller som er amerikanske statsborgere. En reell rettighetshaver kan være skattemessig bosatt i flere land, og opplysningsplikten vil da gjelde for hvert av de aktuelle landene. Opplysninger om reelle rettighetshavere skattemessig bosatt i Norge, skal gis fra inntektsåret 2018. Opplysningsplikten omfatter reelle rettighetshavere i selskap mv. som omtalt i \"rettledning om internasjonal rapportering av finansielle konti – CRS/FATCA \"."
  },
  "objective": {
    "nb": "Norge har inngått avtaler med andre land om automatisk utveksling av opplysninger om finansielle konti. Formålet er å sikre riktig beskatning av konti skattyter har utenfor sitt hjemland."
  },
