    "nb": "Betalinger til selvstendig næringsdrivende"
  },
  "description": {
    "nb": "Opplysninger om betalinger til selvstendig næringsdrivende.\n\nAlle næringsdrivende oppdragsgivere som har kjøpt tjenester fra selvstendig næringsdrivende uten fast forretningssted i inntektsåret omfattes av opplysningsplikten og skal innrapportere det fakturerte beløpet. \n"
  },
  "descriptionFormatted": {
    "nb": "Opplysninger om betalinger til selvstendig næringsdrivende.\n\nAlle næringsdrivende oppdragsgivere som har kjøpt tjenester fra selvstendig næringsdrivende uten fast forretningssted i inntektsåret omfattes av opplysningsplikten og skal innrapportere det fakturerte beløpet. \n"
  },
  "objective": {
    "nb": "Innrapporteringen av utbetaling til selvstendig næringsdrivende vil være med på å avgjøre om den som utfører tjenesten og mottar vederlag (oppdragstakeren) skal ha selvangivelse for næringsdrivende. \n"
  },
