  "title": {
    "nb": "Elveg"
  },
  "description": {
    "nb": "Landsdekkende datasett som viser alle kjørbare veger som er lengre enn 50 meter og gang- og sykkelveger. Datasettet inneholder vegnett med adressepunkt, gatenavn, fartsgrenser, trafikkreguleringer og andre vegrestriksjoner. Datasettet har høy grad av nettverkstopologi og kan for eksempel brukes til bilnavigasjon, ruteplanlegging og -beregning, samfunnsplanlegging, beredskap, adressering, vedlikehold, presentasjon og generell oversikt. Leveranse består av senterlinjegeometri for vegnett, punktgeometri for adresser og enkelte restriksjoner. Leveres som to separate sosifiler med vegnett og adresser, og fire tekstfiler med restriksjoner i kommunevise filer. Disse kan også hentes som fylkesfiler og en landsfil.\n▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬\n17.12.2019. Nå er det lagt ut ny versjon av Elveg 1.0. Den inneholder ny kommunestruktur som er gjeldende fra 01.01.2020. \n\nLitt info om leveransene: \n\n- Filene har tegnsett UTF-8 og alle samiske navn skal være riktige, dvs lik som i adressefilene.\n\n- I tillegg har vi endret navningen på zip-fila som inneholder adresser og geometri for samme kommune. De heter nå eksempelvis 0101Elveg_med_adresser.\n\nVær obs på dette når du henter ny Elveg."
  },
  "descriptionFormatted": {
    "nb": "Landsdekkende datasett som viser alle kjørbare veger som er lengre enn 50 meter og gang- og sykkelveger. Datasettet inneholder vegnett med adressepunkt, gatenavn, fartsgrenser, trafikkreguleringer og andre vegrestriksjoner. Datasettet har høy grad av nettverkstopologi og kan for eksempel brukes til bilnavigasjon, ruteplanlegging og -beregning, samfunnsplanlegging, beredskap, adressering, vedlikehold, presentasjon og generell oversikt. Leveranse består av senterlinjegeometri for vegnett, punktgeometri for adresser og enkelte restriksjoner. Leveres som to separate sosifiler med vegnett og adresser, og fire tekstfiler med restriksjoner i kommunevise filer. Disse kan også hentes som fylkesfiler og en landsfil.\n▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬\n17.12.2019. Nå er det lagt ut ny versjon av Elveg 1.0. Den inneholder ny kommunestruktur som er gjeldende fra 01.01.2020. \n\nLitt info om leveransene: \n\n- Filene har tegnsett UTF-8 og alle samiske navn skal være riktige, dvs lik som i adressefilene.\n\n- I tillegg har vi endret navningen på zip-fila som inneholder adresser og geometri for samme kommune. De heter nå eksempelvis 0101Elveg_med_adresser.\n\nVær obs på dette når du henter ny Elveg."
