  "title": {
    "nb": "Digitalt markslagskart (DMK) - Historisk datasett"
  },
  "description": {
    "nb": "DMK inneheld informasjon om jordtilhøve, myr-egenskaper, driftsforhold på jordbruksareal og detaljert informasjon om produksjonspotensial for skog (bonitet) som ikkje finst i FKB-AR5 eller FKB-dyrkbar jord.\n\n\nDMK var markslagsfolien for økonomisk kartverk og ble erstattet av arealressurskartet AR5 i 2007. Datasettet har følgende kartlag som i dag ikke blir ajourholdt:\nATIL: Arealtilstand \nASKOG: Potensiell skogbonitet\nTSKOG: Tilleggsklassifikasjon av skog og skogreisingsmark\nJORD: Jordklassifikasjon\nMYR: Myrklassifikasjon\nIMP: Impedimentsprosent\nAREA_C: Areal i kvadratmeter\nDatasettet lastes ned kommunevis."
  },
