  "title": {
    "nb": "Sjølaksefiske"
  },
  "description": {
    "nb": "Fiske med faststående redskap etter laks, sjøørret eller sjørøye i sjøen skal registreres i Lakseregisteret - sjølaksefiske av fiskeren. Hver enkelt fisker, fiskeredskap (kilenot, krokgarn og settegarn) og fiskeplass skal registreres. Dette gjelder fiske på egen grunn eller etter avtale med grunneier. \n\nFylkesmannen forvalter registeret i sitt fylke og sender fangstdagbok til fiskeren. Miljødirektoratet har overordnet ansvar for systemet. Til Statistisk sentralbyrå (SSB) får oversikt over registrerte fiskere og mottar utfylte fangstdagbøker fra sjølaksefiskerne etter at fiskesesongen er over."
  },
