  "title": {
    "nb": "Sjøkart - Dybdedata"
  },
  "description": {
    "nb": "Dette er ugraderte dybdedata til fri bruk. \nDybdeinformasjonen er referert til sjøkartnull. Kystkontur, konstruert kyst og skjær er referert til middel høyvann.\nDybdedataene er grunnlag for Kartverkets navigasjonsprodukter og tjenester. \nDybdepunkt og kurveintervall er ihht Forsvarets navigasjonsplan, dvs. 50m mellom dybdepunktene og kurveintervall: 2, 5, 10, 15, 20, 30, 40, 50, 100, 150, 200, 250 etc."
  },
