  "title": {
    "nb": "Marine biotoper i Sør-Troms"
  },
  "description": {
    "nb": "Datasettet viser utbredelsen av marine biotoper i Astafjordene i Sør-Troms. En biotop er et område med en bestemt sammensetning av plante- og dyrearter som lever under ensartede miljøforhold. Hvilke arter dette er, bestemmes av miljøforholdene i området. Ved hjelp av multivariate statistiske metoder og på grunnlag av detaljerte dybdedata, kornstørrelsesdata og info om bunnfauna fra video er det modellert 12 biotopklasser på havbunnen i Astafjorden, Vågsfjorden og Tranøyfjorden med sidefjordene. Biotopdata er et av mange kartproduktene av prosjektet «Marine grunnkart i Sør-Troms» (2002-2012)."
  },
  "descriptionFormatted": {
    "nb": "Datasettet viser utbredelsen av marine biotoper i Astafjordene i Sør-Troms. En biotop er et område med en bestemt sammensetning av plante- og dyrearter som lever under ensartede miljøforhold. Hvilke arter dette er, bestemmes av miljøforholdene i området. Ved hjelp av multivariate statistiske metoder og på grunnlag av detaljerte dybdedata, kornstørrelsesdata og info om bunnfauna fra video er det modellert 12 biotopklasser på havbunnen i Astafjorden, Vågsfjorden og Tranøyfjorden med sidefjordene. Biotopdata er et av mange kartproduktene av prosjektet «Marine grunnkart i Sør-Troms» (2002-2012)."
  },
